import React from 'react';

const DocumentCompleted = () => {
    return (
        <div className="container">
            <div className="document__completed">
                <p> Time </p>
                <p> Node Name </p>
                <p> Operator </p>
                <p> Operation </p>
                <p> Process Opinion </p>
                <div> Time</div>
                <div> Node Name</div>
                <div> Operator</div>
                <div> Operation</div>
                <div className="document__completed-col">
                    <span> Approved </span>
                    <span> 5minute15seconds </span>
                </div>

            </div>
        </div>
    );
};

export default DocumentCompleted;
